  }

  .plane-spinner::before {
    -webkit-transform: translateZ(0);
    -webkit-backface-visibility: hidden;
    transform: translateZ(0);
    backface-visibility: hidden;
    perspective: 1000;
    content: '';
    background: #ffffff;
    display: block;
    width: 67px;
    height: 67px;
    border-radius: 100%;
    position: relative;
    top: 0;
    left: 4px;
  }
  .plane-spinner::after {
    -webkit-transform: translateZ(0);
    -webkit-backface-visibility: hidden;
    transform: translateZ(0);
    backface-visibility: hidden;
    perspective: 1000;
    content: '';
    background: #ffffff;
    display: block;
    position: absolute;
    right: 0;
    bottom: 0;
  }

  @-webkit-keyframes spin {
      0% {transform: rotate(0deg); }
      100% {transform: rotate(360deg); }
  }
